# Fetch the user account & properties in AD	
 function Get-DomainUser {
	PARAM([parameter(Position=1,Mandatory=$true)] [string]$samAccountName)
 	
	try{
	#Write-Host "Function Get-DomainUser looked up user: $samAccountName" -ForegroundColor yellow
    $dom = [System.DirectoryServices.ActiveDirectory.Domain]::GetCurrentDomain()  
	$root = [ADSI]"LDAP://$($dom.Name)"
	
	$search = new-Object System.DirectoryServices.DirectorySearcher($root,"(&(objectCategory=person)(objectClass=User)(samaccountname=$SamAccountName))") 
	#$Search = [adsisearcher]"LDAP://ou=Accounts,ou=users,dc=corpad,dc=dsm-group,dc=com;(&(objectCategory=person)(objectClass=User)(samaccountname=$SamAccountName))"
	$ADResults = @()
	# To limit the properties to load, include lines similar to the following:
	$Search.PropertiesToLoad.Add("samaccountname") | Out-Null
	$Search.PropertiesToLoad.Add("displayname") | Out-Null
	$Search.PropertiesToLoad.Add("telephonenumber") | Out-Null
	$Search.PropertiesToLoad.Add("title") | Out-Null
	$Search.PropertiesToLoad.Add("street") | Out-Null
	$Search.PropertiesToLoad.Add("postofficebox") | Out-Null
	$Search.PropertiesToLoad.Add("homephone") | Out-Null
	$Search.PropertiesToLoad.Add("mobile") | Out-Null
	$Search.PropertiesToLoad.Add("pager") | Out-Null
	$Search.PropertiesToLoad.Add("facsimileTelephoneNumber") | Out-Null
	$searcherResults = $Search.FindOne()
	$ADResults = $searcherResults | select -Expand Properties | select @{n='samaccountname';e={$_.samaccountname}}, @{n='displayname';e={$_.displayname}},@{n='telephonenumber';e={$_.telephonenumber}}, @{n='title';e={$_.title}},@{n='street';e={$_.street}}, @{n='postofficebox';e={$_.postofficebox}},@{n='homephone';e={$_.homephone}}, @{n='mobile';e={$_.mobile}},@{n='pager';e={$_.pager}}, @{n='facsimileTelephoneNumber';e={$_.facsimileTelephoneNumber}},@{n='adspath';e={$_.adspath}}
	#write-host @"
#Function Get-DomainUser fetched these properties:
#$ADResults
#"@ -ForegroundColor Green
	
	# Fill the form
	$samaccountBox.Text = (($ADResults.samaccountname) | Out-String).Trim()
	$displaynameBox.Text = ($ADResults.displayname | Out-String).Trim()
	$jobtitleBox.Text = ($ADResults.title | Out-String).Trim()
	$telBox.Text = ($ADResults.telephonenumber | Out-String).Trim()
	$streetBox.Text = ($ADResults.street | Out-String).Trim()
	$poBox.Text = ($ADResults.postofficebox | Out-String).Trim()
	$homeBox.Text = ($ADResults.homephone | Out-String).Trim()
	$mobileBox.Text = ($ADResults.mobile | Out-String).Trim()
	$pagerBox.Text = ($ADResults.pager | Out-String).Trim()
	$faxBox.Text = ($ADResults.facsimileTelephoneNumber | Out-String).Trim()
	$global:adspath = ($ADResults.adspath | Out-String).Trim()
		}
	catch{
		$ErrorMessage = $_.Exception.Message
    	$FailedItem = ($_.Exception.GetType().FullName)
		
		[void][System.Windows.Forms.MessageBox]::Show($ErrorMessage,$FailedItem,0,16)
		break
		
	}

}

 function Set-DomainUser {
 #write the values back
    PARAM($attribute,$value)
		
	try{	
	$dom = [System.DirectoryServices.ActiveDirectory.Domain]::GetCurrentDomain()  
	$root = [ADSI]"LDAP://$($dom.Name)"
	 
	$search = new-Object System.DirectoryServices.DirectorySearcher($root,"(&(objectCategory=person)(objectClass=User)(samaccountname=$samname))") 
    #$Search = [adsisearcher]"(&(objectCategory=person)(objectClass=User)(samaccountname=$samname))"
	# To limit the properties to load, include lines similar to the following:
	$Search.PropertiesToLoad.Add($attribute) | Out-Null
	$searcherResults = $Search.FindOne()

	foreach($objResult in $searcherResults) {
    $dirObject = [ADSI]$objResult.GetDirectoryEntry()
    if(($value -eq "") -or ($value -eq $null)){
	$dirObject.PutEx(1,$attribute, 0)
	}
	else{
	$dirObject.Put($attribute,@($value))
	
	}	
	}
	#$dirObject.SetInfo()
	$dirObject.CommitChanges()
		}
	
		catch{
		$ErrorMessage = $_.Exception.Message
    	$FailedItem = ($_.Exception.GetType().FullName)
		[void][System.Windows.Forms.MessageBox]::Show($ErrorMessage,$FailedItem,0,16)
		break
		

		}
}

