	mobile = $mobileBox.Text
	pager = $pagerBox.Text
	facsimileTelephoneNumber = $faxBox.Text
	}
	New-Object PSObject -Property $newValues
	

# Enumerate through hashtable and call write back function	
$newValues.GetEnumerator() | foreach {
Set-DomainUser -attribute $_.Key -Value $_.Value
#Write-Host Script will set $_.Key to $_.Value
}
[void][System.Windows.Forms.MessageBox]::Show("Done!","Settings saved!")
}

